import React,{Component} from 'react';

class MainPage extends Component{

  render(){
    return(
  <div class="carousel">
    <a class="carousel-item" href="#one!"><img src="img/posh.jpg" /></a>
    <a class="carousel-item" href="#two!"><img src="img/posh.jpg" /></a>
    <a class="carousel-item" href="#three!"><img src="img/posh.jpg" /></a>
  </div>
    )
  }
}

export default MainPage;
